import React, { useEffect, useState } from 'react';
import { useParams, useNavigate, Link } from 'react-router-dom';
import api from '../services/api';

export default function PetDetails() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [pet, setPet] = useState(null);
  const [eventos, setEventos] = useState([]);

  useEffect(() => {
    api.get(`/pets/${id}`).then(response => {
      setPet(response.data);
    });
    api.get(`/eventos/pet/${id}`).then(response => {
      setEventos(response.data);
    });
  }, [id]);

  const handleDelete = async () => {
    if (window.confirm('Tem certeza que deseja excluir este pet?')) {
      await api.delete(`/pets/${id}`);
      navigate('/pets');
    }
  };

  const handleCheckout = async (eventoId) => {
    try {
      await api.put(`/eventos/${eventoId}/checkout`);
      const atualizados = await api.get(`/eventos/pet/${id}`);
      setEventos(atualizados.data);
    } catch (err) {
      alert('Erro ao fazer check-out');
    }
  };

  if (!pet) return <p>Carregando pet...</p>;

  return (
    <div className="container my-4">
      <div className="d-flex justify-content-between">
        <button onClick={() => navigate('/pets')} className="btn btn-secondary mb-3">← Voltar à Lista</button>
        <Link to={`/pets/${id}/novo-evento`} className="btn btn-success mb-3">Cadastrar Evento</Link>
      </div>

      <h3>Detalhes do Pet</h3>
      <ul className="list-group mb-3">
        <li className="list-group-item"><strong>Nome:</strong> {pet.nome}</li>
        <li className="list-group-item"><strong>Espécie:</strong> {pet.especie}</li>
        <li className="list-group-item"><strong>Raça:</strong> {pet.raca}</li>
        <li className="list-group-item"><strong>Idade:</strong> {pet.idade} anos</li>
        <li className="list-group-item"><strong>Porte:</strong> {pet.porte}</li>
        <li className="list-group-item"><strong>Cor:</strong> {pet.cor}</li>
        <li className="list-group-item"><strong>Sexo:</strong> {pet.sexo}</li>
        <li className="list-group-item"><strong>Peso:</strong> {pet.peso} kg</li>
        <li className="list-group-item"><strong>Castrado:</strong> {pet.castrado ? 'Sim' : 'Não'}</li>
        <li className="list-group-item"><strong>Carteira de Vacinação em Dia:</strong> {pet.carteiraVacinacao ? 'Sim' : 'Não'}</li>
        <li className="list-group-item"><strong>Data de Cadastro:</strong> {new Date(pet.dataCadastro).toLocaleDateString('pt-BR')}</li>
        {pet.observacoes && (
          <li className="list-group-item"><strong>Observações:</strong> {pet.observacoes}</li>
        )}
      </ul>

      <div className="mb-3">
        <Link to={`/pets/${id}/editar`} className="btn btn-warning me-2">Editar</Link>
        <button onClick={handleDelete} className="btn btn-danger">Excluir</button>
      </div>

      <h5 className="mt-4">Eventos relacionados</h5>
      <ul className="list-group">
        {eventos.map(evento => (
          <li key={evento._id} className="list-group-item d-flex justify-content-between align-items-center">
            <span>
              <strong>{evento.tipo}</strong> - Check-in: {new Date(evento.dataEntrada).toLocaleDateString('pt-BR')} -
              Check-out: {evento.dataSaida ? new Date(evento.dataSaida).toLocaleDateString('pt-BR') : 'em andamento'}
            </span>
            {!evento.dataSaida && (
              <button onClick={() => handleCheckout(evento._id)} className="btn btn-outline-success btn-sm">
                Fazer Check-out
              </button>
            )}
          </li>
        ))}
      </ul>
    </div>
  );
}
